import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import BillingOperations from "C:\\Users\\GWYNN CUJARDO\\Documents\\GitHub\\e-billing\\src\\components\\BillingOperations.js";
import Transaction from "C:\\Users\\GWYNN CUJARDO\\Documents\\GitHub\\e-billing\\src\\components\\Transaction.js";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={BillingOperations} />
        <Route path="/transaction/:biller" component={Transaction} />
      </Switch>
    </Router>
  );
};

export default App;
